function status(txt) {
  document.getElementById('status').innerHTML = txt
}

function updateTableContent(fields, contentjson){
  var rows = '';
  $.each(contentjson, function(index, item) {
      var row = '<tr role="row" class="odd">';
      $.each(fields, function(index, field) {
          row += '<td>' + item[field+''] + '</td>';
      });
      //Button
      row += '<td class="text-right"> <button type="button" name="removeInvestor" class="btn btn-secondary" aria-haspopup="true" style="width: 150px;" aria-expanded="false"> Remove </button></td>'
      rows += row + '<tr>';
  });
  $('#' + 'TableContent').html(rows);
}

function updateJsonContent(){
  var investorAdded = ProjectCrowdsaleInstance.WhitelistedInvestorAdded();
  investorAdded.watch(function(error, result){
    if (!error){
      var jsonObj = JSON.parse(localStorage.getItem('investors-listing'));
      var newObj = {field1: '<span class="text-muted">KYC in progress</span>', field2: '<span class="text-muted">KYC in progress</span>', field3: '0x06b71b93A1B23D30dbD22209F742a1A053289fC3', field4: '<span class="text-muted">KYC in progress</span>', field5: '<span class="text-muted">KYC in progress</span>', field6: '<span class="status-icon bg-danger"></span> Pending' };
      console.log('New Added Investor: ', result)
      newObj.field3 = result;
      jsonObj.concat(newObj);
      //Update Table
      localStorage.setItem('investors-listing', JSON.stringify(jsonObj));
    }
  });
}


// ======= ProjectCrowdsale methods ==========
function addWhitelistedInvestor(){
	var button = document.getElementById('addInvestor');
	button.addEventListener('click', function(){
		status("Adding investor...");
    var account = document.getElementById('account').value;
		ProjectCrowdsaleInstance.addWhitelistedInvestor(account)
		.then(function(setTxHash){
      status("Investor added.");
      var jsonObj = JSON.parse(localStorage.getItem('investors-listing'));
      var newObj = {field1: '<span class="text-muted">KYC in progress</span>', field2: '<span class="text-muted">KYC in progress</span>', field3: account, field4: '<span class="text-muted">KYC in progress</span>', field5: '<span class="status-icon bg-danger"></span> Pending', field6: '0' };
      console.log('New Added Investor: ', account)
      newObj.field3 = account;
      jsonObj = jsonObj.concat(newObj);
      //Update Table
      localStorage.setItem('investors-listing', JSON.stringify(jsonObj));
      console.log("Tx confirmed: ", setTxHash)
    })
    .catch(function(transferError) {
      console.log(transferError)
    });
	});
}

function removeWhitelistedInvestor(){
  // TOFIX: need to identify which address to remove
  $('button[name="removeInvestor"]').click(function(){
    status("Removing investor...")
    var account = document.getElementById('account').value;
		ProjectCrowdsaleInstance.removeWhitelistedInvestor(account)
		.then(function(setTxHash){
			status("Investor removed.")
			document.getElementById('Investor').innerHTML = 'Transaction hash: ' + String(setTxHash);
		});
  });
}

function crowdsalefallback(to){
	var button = document.getElementById('crowdsale-fallback');
	button.addEventListener('click', function(){
		// TODO
		if (document.getElementById('amount') != null){
			var amount = document.getElementById('amount').value;
		} else {
			alert('Enter an amount')
		}
		status("Sending transaction...")
		var transaction = {
			from: accounts[0],
			to: to,
			value: web3.toWei(String(amount), 'ether'),
			gas: 6000000
		}
		eth.sendTransaction(transaction, function(err, txHash){
			document.getElementById('fallback-hash').innerHTML = txHash;
		})
		.catch(function(error){
			status('There was an error: ' + String(error));
		})
	});
}

function tokenAddress(){
	var button = document.getElementById('token');
	button.addEventListener('click', function(){
		console.log('Token Address Button clicked')
		ProjectCrowdsaleInstance.token().then(function(value){
			console.log(value[0]);
			document.getElementById('p-token').innerHTML = 'Token address: ' + value[0].toString(16);
		});
	});
}

function WeiRaised(){
  ProjectCrowdsaleInstance.weiRaised().then(function(value){
    document.getElementById('weiRaised').innerHTML = web3.fromWei(value[0], 'ether') + ' ETH raised';
    ProjectCrowdsaleInstance.cap().then(function(cap){
      console.log("CAP: ", web3.fromWei(cap[0], 'ether'))
      console.log("type: ", typeof(Number(web3.fromWei(cap[0], 'ether'))))
      console.log("Weiraised: ", web3.fromWei(value[0], 'ether'))
      var proportion = Number(web3.fromWei(value[0], 'ether'))/Number(web3.fromWei(cap[0], 'ether'));
      document.getElementById('weiRaisedPerCent').innerHTML = proportion*100 + '%';
      // Update status bar
      document.getElementById('fundraising-bar').setAttribute("aria-valuenow", String(proportion*100));
      document.getElementById('fundraising-bar').setAttribute("style", "width: "+proportion*100+"%");
  	});
  });
}

function updateWeiRaised(){
  // Initialization
  WeiRaised();
  // Listen to Smart Contract event
  var tokenPurchased = ProjectCrowdsaleInstance.TokensPurchased();
  tokenPurchased.watch(function(error, result){
    console.log('on watch')
    if (!error){
      WeiRaised();
    } else {
        console.log(error);
    }
  });
}

function getCap(){
	ProjectCrowdsaleInstance.cap().then(function(value){
      console.log("Cap: ", value[0].toString(10))
      return value[0];
	});
}

function capReached(){
	ProjectCrowdsaleInstance.capReached().then(function(value){
      console.log("Cap Reached: ", value[0].toString(10))
			return value[0].toString(10);
	});
}
